USE Bookings
GO

DELETE FROM RoomTypeImage
DELETE FROM [HotelImage]

DECLARE @RoomTypes table (Id int IDENTITY(1,1), RoomTypeId uniqueidentifier); 
DECLARE	@CurrentIndex int = 1, @MaxIndex int, @CurrentRoomTypeId uniqueidentifier, @CurrentHotelId uniqueidentifier;

DECLARE @Hotel_CharingCross uniqueidentifier,			@Hotel_JurysInnGalway uniqueidentifier,			@Hotel_TheHendrickSmithfieldOpens uniqueidentifier,
@Hotel_Blooms uniqueidentifier,							@Hotel_DonegalEstuaryHoliday uniqueidentifier,	@Hotel_Flannery uniqueidentifier,
@Hotel_TrinityCity uniqueidentifier,					@Hotel_DunmillApartment uniqueidentifier,		@Hotel_Number53 uniqueidentifier,
@Hotel_MarlinStephensGreen uniqueidentifier,			@Hotel_GraftonStreetStudios uniqueidentifier,	@Hotel_EddieCottage uniqueidentifier,
@Hotel_ClybaunHotel uniqueidentifier,					@Hotel_GalwayCityHostel uniqueidentifier;

DECLARE @HotelIds AS table(Id int IDENTITY(1,1), HotelId uniqueidentifier)

INSERT INTO @RoomTypes (RoomTypeId)
SELECT Id FROM RoomType WHERE [Name] IN
	('Double Room with Shared Bathroom',
	'Standard Twin Room with Shared Bathroom',
	'Twin Room with Private Bathroom',
	'Family Room with Shared Bathroom',
	'Family Room with Private Bathroom',
	'Quadruple Room with Private Bathroom',
	'King Room',
	'Loft Studio',
	'Superior Studio',
	'Superior Twin Room',
	'Deluxe Double Room',
	'Deluxe Twin Room',
	'Deluxe Double & Single Room',
	'Executive King Room',
	'Executive Double Double Room',
	'Deluxe King Room',
	'Double Room',
	'Twin Room',
	'Double with Bunk Bed',
	'Double Room - Disability Access',
	'Double Room with Private Bath',
	'Cozy King Room')

SELECT @MaxIndex = MAX(Id) FROM @RoomTypes

WHILE @CurrentIndex <= @MaxIndex
BEGIN
	SELECT @CurrentRoomTypeId = RoomTypeId
	FROM @RoomTypes
	WHERE Id = @CurrentIndex

	INSERT INTO [RoomTypeImage] ([Id], [Image], RoomTypeId, [Order])
	SELECT [Id], [Image], RoomTypeId, [Order]
	FROM (VALUES (
		NEWID(), 
		'data:image/jpeg;base64,',
		@CurrentRoomTypeId,
		1
	),
	(
		NEWID(), 
		'data:image/jpeg;base64,',
		@CurrentRoomTypeId,
		2
	),
	(
		NEWID(), 
		'data:image/jpeg;base64,',
		@CurrentRoomTypeId,
		3
	),
	(
		NEWID(), 
		'data:image/jpeg;base64,',
		@CurrentRoomTypeId,
		4
	),
	(
		NEWID(), 
		'data:image/jpeg;base64,',
		@CurrentRoomTypeId,
		5
	)) AS v([Id], [Image], RoomTypeId, [Order])

	SET @CurrentIndex = @CurrentIndex + 1
END

INSERT INTO @HotelIds(HotelId)
SELECT Id FROM HOTEL WHERE [Name] IN ('Charing Cross Hotel',			'Jurys Inn Galway',			'The Hendrick Smithfield',			'Blooms Hotel',
									'Donegal Estuary Holiday Homes',	'Flannerys Hotel',			'Trinity City Hotel',				'Dunmill Apartment',
									'Number 53',						'Marlin Hotel Stephens Green','Grafton Street Studios',			'Eddie''s Cottage',
									'Clybaun Hotel',					'Galway City Hostel')

SELECT @CurrentIndex = 1, @MaxIndex = MAX(Id) FROM @HotelIds

WHILE @CurrentIndex <= @MaxIndex
BEGIN
	SELECT @CurrentHotelId = HotelId FROM @HotelIds WHERE Id = @CurrentIndex

	INSERT INTO [dbo].[HotelImage] ([Id], [Image], [HotelId], [Order])
	SELECT [Id], [Image], [HotelId], [Order]
	FROM (VALUES (
		NEWID(), 
		'data:image/jpeg;base64,', 
		@CurrentHotelId,
		1
	),
	(
		NEWID(), 
		'data:image/jpeg;base64,', 
		@CurrentHotelId,
		2
	),
	(
		NEWID(), 
		'data:image/jpeg;base64,', 
		@CurrentHotelId,
		3
	),
	(
		NEWID(), 
		'data:image/jpeg;base64,', 
		@CurrentHotelId,
		4
	),
	(
		NEWID(), 
		'data:image/jpeg;base64,', 
		@CurrentHotelId,
		5
	)) AS v([Id], [Image], [HotelId], [Order])

	SET @CurrentIndex = @CurrentIndex + 1
END